import React,{Component} from 'react';


class Header extends Component
{
    render() {
        return(<div style={HeaderStyle}><h1>Railway Reservation Sytem</h1></div>);
    }
}

const HeaderStyle={

    background:'LightGrey',
    height:'100px',
    textAlign:'center',
    border: '3px solid Black'
};
export default Header;
